import axios from "axios";

const headers = (cookie) => ({
  Cookie: `.ROBLOSECURITY=${cookie}`,
});

async function checkUserPremiumStatus(userId) {
  try {
    const response = await axios.get(
      `https://premiumfeatures.roblox.com/v1/users/${userId}/validate-membership`,
      {
        headers: headers(
          "_|WARNING:-DO-NOT-SHARE-THIS.--Sharing-this-will-allow-someone-to-log-in-as-you-and-to-steal-your-ROBUX-and-items.|_"
        ),
      }
    );

    if (response.data && response.data.premium) {
      console.log(`User ${userId} has a Premium membership.`);
      return true;
    } else {
      console.log(`User ${userId} does not have a Premium membership.`);
      return false;
    }
  } catch (error) {
    console.error("Error checking Premium status:", error);
    return false;
  }
}

// Example usage:
checkUserPremiumStatus("19717956");
